import React from 'react';

function Home() {
    return(
        <section>
            <div class="container-fluid">
                <h1 class="mt-5">Welcome</h1>
                <p>This site was created using Node JS with React and MySQL.</p>
                <p>This site is intended to simulate an inventory management system for a local Chic-fil-a. This project is a collaboration from:
                    <ul>
                        <li>Dawson Hormuth</li>
                        <li>Ian Turner</li>
                        <li>Andrew Moffett</li>
                    </ul>
                </p>
            </div>
        </section>
    );
}

export default Home;
